import React, { Component } from 'react'
import { Slide } from 'react-slideshow-image';
import './ImgSlideBar.css'

export default class ImgSlideBar extends Component {
    render() {

        const canSwipeExample = () => {
            const images = [
              "src='https://static.bangkokpost.com/media/content/dcx/2020/02/07/3517079.jpg'",
              "src='https://cf.bstatic.com/images/hotel/max1280x900/991/9918189.jpg'",
              "src='https://media-cdn.tripadvisor.com/media/photo-s/0e/65/a7/24/best-western-premier.jpg'"
            ];
        }
        const fadeProperties = {
            duration: 3000,
            canSwipe: false,
                      };

        return (
            <div>
                <h2>Fade Effect</h2>
      <div className="slide-container">
        <Slide {...fadeProperties}>
          <div className="each-fade">
            <div>
              <img src={images[0]} />
            </div>
            <p>First Slide</p>
          </div>
          <div className="each-fade">
            <p>Second Slide</p>
            <div>
              <img src={images[1]} />
            </div>
          </div>
          <div className="each-fade">
            <div>
              <img src={fadeImages[2]} />
            </div>
            <p>Third Slide</p>
          </div>
        </Slide>
      </div>
            </div>
        )
    }
}
